import React, { Fragment } from "react";
import mealImg from "../../assets/meals.jpg";
import classes from "./Header.module.css";

const Header = () => {
  return (
    <Fragment>
      <header className={classes.Header}>
        <h1>FoodMeals</h1>
        <button>Cart</button>
      </header>
      <div className={classes["main-image"]}>
        <img src={mealImg} />
      </div>
    </Fragment>
  );
};

export default Header;
